import React from 'react';

class Header extends React.Component {

  render() {
    return (
        <div className="Header">
          {
              <ul>
                  {this.props.pages.map(item => (
                      <li key={item}>{item}</li>
                  ))}
              </ul>
          }
        </div>
    );
  }

}

export default Header;
